  public static  String entityParser(String text) {
    StringBuilder result = new StringBuilder();
    StringBuilder temp = new StringBuilder();
    Map<String, String> htmlMap = new HashMap<>();
    htmlMap.put("&quot;", "\"");
    htmlMap.put("&apos;", "\'");
    htmlMap.put("&amp;", "&");
    htmlMap.put("&gt;", ">");
    htmlMap.put("&lt;", "<");
    htmlMap.put("&frasl;", "/");
    boolean isStart = false;
    for (int i = 0; i < text.toCharArray().length; i++) {
      char c = text.charAt(i);
      if (c == '&') {
        temp.append(c);
        isStart = true;
      } else if (c == ';' && isStart) {
        temp.append(c);
        String html = "";
        if (temp.length() < 8) {
          html = htmlMap.getOrDefault(temp.toString(), "");
        }

        if (!html.equals("")) {
          result.append(html);
        } else {
          result.append(temp);
        }
        isStart = false;
        temp = new StringBuilder();
      } else {
        if (isStart) {
          temp.append(c);
        } else {

          result.append(c);
        }
      }
    }
    return result.toString();
  }
  public static  String entityParser2(String text) {
    Map<String, String> htmlMap = new HashMap<>();
    htmlMap.put("&quot;", "\"");
    htmlMap.put("&apos;", "\'");
    htmlMap.put("&amp;", "&");
    htmlMap.put("&gt;", ">");
    htmlMap.put("&lt;", "<");
    htmlMap.put("&frasl;", "/");
    for (String s : htmlMap.keySet()) {
      text = text.replaceAll(s, htmlMap.get(s));
    }

    return text;
  }

  private static Map<String, String> getHTMLMap() {

    Map<String, String> map = new HashMap<>();
    map.put("&quot;", "\"");
    map.put("&apos;", "\'");
    map.put("&amp;", "&");
    map.put("&gt;", ">");
    map.put("&lt;", "<");
    map.put("&frasl;", "/");
    return map;

  }
